import React, { useState } from 'react';
import { CircularProgress } from 'material-ui';

const Spinner = () => {
  const [modalIsOpen, setModalIsOpen] = useState(false);

  return (
    <div>
      <CircularProgress />
    </div>
  );
};

export default Spinner;
